import ImpactDashboard from "../components/ImpactDashboard";

function Home() {
  return (
    <main>
      <header>
        <h1>TMS Foundation Portal</h1>
        <p>Transparent impact overview for donors and stakeholders.</p>
      </header>
      <ImpactDashboard />
    </main>
  );
}

export default Home;
